/**
 * Navigation
 *
 * Takes an array to render the links
 *
 */

import * as React from "react";
import { Link } from "react-router-dom";
import Styled from "./styles/Styled";
import slackChatLogoPng from "../../assets/branding/slack-chat-logo.png";

interface INavigationContent {
  name: string;
  url: string;
}

interface INavigation extends INavigationContent {
  items: INavigationContent[];
}

const Navigation: React.SFC<INavigation> = ({ items }) => (
  <Styled.Header>
    <Styled.Nav>
      <Link to="/">
        <Styled.Img src={slackChatLogoPng} alt={slackChatLogoPng} />
      </Link>
      {items.map((item) => (
        <Styled.A key={item.name} to={`/${item.url}`} role="link">
          {item.name}
        </Styled.A>
      ))}
    </Styled.Nav>
  </Styled.Header>
);

export default Navigation;
try {
    // @ts-ignore
    Navigation.displayName = "Navigation";
    // @ts-ignore
    Navigation.__docgenInfo = { "description": "", "displayName": "Navigation", "props": { "items": { "defaultValue": null, "description": "", "name": "items", "required": true, "type": { "name": "INavigationContent[]" } }, "name": { "defaultValue": null, "description": "", "name": "name", "required": true, "type": { "name": "string" } }, "url": { "defaultValue": null, "description": "", "name": "url", "required": true, "type": { "name": "string" } } } };
    // @ts-ignore
    if (typeof STORYBOOK_REACT_CLASSES !== "undefined")
        // @ts-ignore
        STORYBOOK_REACT_CLASSES["src/components/Navigation/Navigation.tsx#Navigation"] = { docgenInfo: Navigation.__docgenInfo, name: "Navigation", path: "src/components/Navigation/Navigation.tsx#Navigation" };
}
catch (__react_docgen_typescript_loader_error) { }
